import React from "react";
import { formatPrice } from "../helpers";

class Order extends React.Component {
  render() {
    const { order, fishes } = this.props;

    // grab keys of all fish in orders
    const orderIds = Object.keys(order);

    orderIds.map((key) => {
      // for each fish, print out name, # ordered, price
      console.log("Name is: ", fishes[key].name);
      console.log("Number ordered: ", order[key]);
      console.log("Price is: ", formatPrice(fishes[key].price * order[key]));
    });

    return (
      <div className="order-wrap">
        <h2>Order</h2>
      </div>
    );
  }
}
export default Order;
